```python
def prime_factors(num_list):
    def factors(n):
        i = 2
        factors = set()
        while i * i <= n:
            if n % i:
                i += 1
            else:
                n //= i
                factors.add(i)
        if n > 1:
            factors.add(n)
        return factors

    return factors(num_list[64])
```
Note: The index 64 refers to the 65th element in the list since indexing starts at 0 in Python.
